import styled from "styled-components";
import { Carousel, CarouselItem } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const StyledCarousel = styled(Carousel)`
  .carousel-control-prev, .carousel-control-next {
    display: none;
  }

  .carousel-indicators {
    li {
      background-color: #ddd;
      border-radius: 50%;
      width: 10px;
      height: 10px;
      margin: 0 5px;
    }

    .active {
      background-color: #007bff;
    }
  }
`;

function MainSecVideoCTA() {

    const Videos = ["https://www.youtube-nocookie.com/embed/28xeZIh_cqA", "https://www.youtube-nocookie.com/embed/thSPGPnuuNg", "https://www.youtube-nocookie.com/embed/C4-Qg7Owurc"]

    return (

        <StyledCarousel interval={null}>
            {Videos.map((video, index) => (
                <CarouselItem key={index}>
                    <Iframe
                width="854"
                height="480"
                src={video}
                title="YouTube video player"
                frameborder="0"
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
                allowfullscreen>
            </Iframe>
                </CarouselItem>
            ))}
            
        </StyledCarousel>
    )
}

export default MainSecVideoCTA
